edFactorTest <- factor(titanicDatasetTest$Embarked)\n","embarkedDummyTest <- model.matrix(~embarkedFactorTest)\n","\n","# Unir los dataset dummies al dataset original\n","titanicDataset <-data.frame(titanicDataset,\"sexDummy\" = sexDummy[,2],\"embarkedDummy\" = embarkedDummy[,2:3])\n","titanicDatasetTest <-data.frame(titanicDatasetTest,\"sexDummy\" = sexDummyTest[,2],\"embarkedDummy\" = embarkedDummyTest[,2:3])\n","\n","# Se ajustan las columnas para que solo tome las columnas dummies\n","titanicDataset$Sex <- titanicDataset$sexDummy\n","titanicDataset$sexDummy <- NULL\n","\n","titanicDatasetTest$Sex <- titanicDatasetTest$sexDummy\n","titanicDatasetTest$sexDummy <- NULL\n","\n","titanicDataset$Embarked <- NULL\n","\n","titanicDatasetTest$Embarked <- NULL\n","colnames(titanicDatasetTest)[10] <- \"embarkedDummy.embarkedFactorQ\"\n","colnames(titanicDatasetTest)[11] <- \"embarkedDummy.embarkedFactorS\"\n","\n","#View(titanicDataset)\n","#View(titanicDatasetTest)\n","\n","#dim(titanicDataset)\n","#dim(titanicDatasetTest)"]},{"cell_type":"code","execution_count":13,"id":"6d539508","metadata":{"_cell_guid":"b40ef3d8-16e4-4665-ac1f-25ff308f623d","_uuid":"3c81c064-a9ab-4f91-be7f-3e19371e6fca","collapsed":false,"execution":{"iopub.execute_input":"2022-04-06T05:11:14.09763Z","iopub.status.busy":"2022-04-06T05:11:14.096285Z","iopub.status.idle":"2022-04-06T05:11:14.108706Z","shell.execute_reply":"2022-04-06T05:11:14.107326Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.103432,"end_time":"2022-04-06T05:11:14.108881","exception":false,"start_time":"2022-04-06T05:11:14.005449","status":"completed"},"tags":[]},"outputs":[],"source":["#Almacenamos el dataset limpio\n","#write.csv(titanicDataset, \"titanic.csv\")"]},{"cell_type":"code","execution_count":14,"id":"b4173c85","metadata":{"_cell_guid":"e5400f1d-488f-4ab8-bf3d-e2d36aa087cf","_uuid":"8a60e7a2-0e87-4890-a196-b283c6215c00","collapsed":false,"execution":{"iopub.execute_input":"2022-04-06T05:11:14.304379Z","io